class Bottomnav extends Component {
  render() {
    return (
      <nav className="navbar">
        <a className="nav-item nav-link" href="/login">
          Log-in{" "}
        </a>
        <a className="nav-item nav-link" href="/createaccount">
          Create Account{" "}
        </a>
      </nav>
    );
  }
}
export default Bottomnav;
